import React, { Component } from "react";

class ProjectCard extends Component {
  state = {};
  render() {
    return (
      <div className="card">
        <img
          className="card-img bg-blur bg-overlay"
          src={this.props.image}
          alt="Project"
        />
        <div className="card-img-overlay">
          <h5 className="card-title">
            <span className="badge badge-warning">{this.props.title}</span>
          </h5>
          <p className="card-text">
            <kbd>{this.props.text}</kbd>
          </p>
          <p className="card-text">
            <code>
              {this.props.tags.map(tag => {
                return <span className="badge badge-info m-1">{tag}</span>;
              })}
            </code>
          </p>
        </div>
        <div className="card-footer">
          <a href={this.props.link} className="btn btn-dark" target="_black">
            Visit on GitHub
          </a>
        </div>
      </div>
    );
  }
}

export default ProjectCard;
